import React, { useEffect, useState } from 'react';
import  useWebsocket  from 'react-use-websocket';

const TagForm = () => {
  const [tagData, setTagData] = useState("");
  const { lastJsonMessage } = useWebsocket('ws://localhost:8082',
  {
    onOpen: () => console.log(`Connected to App WS`),
    onMessage: () => {
      if (lastJsonMessage) {
        console.log(lastJsonMessage);
        setTagData(lastJsonMessage);
      }
    },

  }); // Substitua pelo seu endereço WebSocket

  useEffect(() => {
    console.log(lastJsonMessage);
    if (lastJsonMessage) {
      setTagData(lastJsonMessage);
    }

  }, [lastJsonMessage]);

  return (
    <div>
      <h1>Tag recebida no frontend:</h1>
      {tagData ? (
        <pre>{JSON.stringify(tagData, null, 2)}</pre>
      ) : (
        <p>Aguardando dados do servidor...</p>
      )}
    </div>
  );
};

export default TagForm;
